        }
        const pdfData = new Uint8Array(byteNumbers);

        pdfjsLib.getDocument({ data: pdfData }).promise.then(function (pdfDoc) {
          document.getElementById("page-count").textContent = pdfDoc.numPages;
          renderPage(pdfDoc, 1);
          setupControls(pdfDoc);
        });
      }

      function renderPage(pdfDoc, num) {
        pdfDoc.getPage(num).then(function (page) {
          const viewport = page.getViewport({ scale: 1.5 });
          canvas.width = viewport.width;
          canvas.height = viewport.height;

          const renderContext = {
            canvasContext: ctx,
            viewport: viewport,
          };
          page.render(renderContext);
          document.getElementById("page-num").textContent = num;
          canvas.setAttribute("data-current-page", num);
          canvas.setAttribute("data-total-pages", pdfDoc.numPages);
        });
      }

      function setupControls(pdfDoc) {
        document.getElementById("prev").onclick = function () {
          let current = parseInt(canvas.getAttribute("data-current-page"));
          if (current > 1) renderPage(pdfDoc, current - 1);
        };
        document.getElementById("next").onclick = function () {
          let current = parseInt(canvas.getAttribute("data-current-page"));
          let total = parseInt(canvas.getAttribute("data-total-pages"));
          if (current < total) renderPage(pdfDoc, current + 1);
        };
      }

      document
        .getElementById("fileSelect")
        .addEventListener("change", function (e) {
          const selected = e.target.value;
          loadPDF(pdfFiles[selected]);
        });

      // Load first file by default
      loadPDF(pdfFiles["Daihatsu Luxio"]);
    </script>
    <style>
      body {
        background: #f4f4f4;
        font-family: Arial;
        margin: 0;
        -webkit-user-select: none;
        user-select: none;
      }

      .dashboard {
        padding: 20px;
        text-align: center;
      }

      select,
      button {
        padding: 8px 12px;
        margin: 10px;
      }

      canvas {
        border: 1px solid #ccc;
        margin: 10px auto;
        display: block;
      }

      .watermark {
        position: fixed;
        top: 40%;
        left: 30%;
        font-size: 4rem;
        opacity: 0.05;
        color: red;
        transform: rotate(-30deg);
        z-index: 9999;
        pointer-events: none;
      }
    </style>
  </head>
  <body>
    <div class="watermark">CONFIDENTIAL</div>

    <div class="dashboard">
      <h2>PDF Inline Dashboard (View Only)</h2>
      <label>Pilih File:</label>
      <select id="fileSelect">
        <option>Daihatsu Luxio</option>
        <option>Toyota Rush</option>
        <option>KIA Travello</option>
        <option>Toyota Etios</option>
        <option>Isuzu Panther New</option>
        <option>Isuzu Panther New 2</option>
        <option>Toyota Kijang 237W</option>
        <option>Toyota Kijang Type 7K-E</option>
        <option>Toyota Kijang Type 1RZ-E</option>
        <option>Toyota New Camry 185 W</option>
      </select>

      <div>
        <button id="prev">Previous</button>
        <span
          >Page: <span id="page-num">1</span> /
          <span id="page-count">1</span></span
        >
        <button id="next">Next</button>
      </div>

      <canvas id="pdf-canvas"></canvas>
    </div>
  </body>
</html>
